var meta = JSON.stringify({
    desc: GM_info.script.description,
    version: GM_info.script.version,
    updates: GM_info.scriptWillUpdate,
    url: GM_info.scriptUpdateURL
});

function content(meta) {
    // Restore removed friend formatter function
    Chat.Formatter.formatFriendClient = function (client) {
        var clientInfo = $(Chat.Formatter.formatClient(client)).removeAttr("onclick"),
                div = $("<div class='friend_client' onclick='ChatWindow.Client.onClick(arguments, \""+ client.id +"\");' />"),
                charData = $("<div class='friend_char' />");

        var avatar = $("<div class='friend_avatar_inner' />");
        if (client.avatar) {
            if ("null" != client.avatar.background)
                tw2widget.avatarPicture(avatar, 'small', client.avatar);
            else if (client.subClass) {
                avatar.append(
                        "<img class='old-avatar' src='images/avatars/"+ client.subClass +"_small.png' alt='' />"
                );
            }
        }

        if (client.level)
            div.append("<div class='friend_level'>" + client.level + "</div>");

        if (client.charClass)
            charData.append(Chat.Formatter.getClassImage(client.charClass));

        if (undefined != client.professionId)
            charData.append(Chat.Formatter.getProfessionImage(client.professionId));

        return div.click(onclick).append(
                $("<div class='friend_avatar' />").append(
                        avatar,
                        "<div class='friend_avatar_frame' />"),
                charData,
                $("<div class='friend_details' />").append(
                        clientInfo, "<br />",
                        Chat.Formatter.formatStatus(client))
        );
    };

    // Restore removed friends list function
    var updateFriendsList = function (client) {
        var friends = Chat.Friendslist.getFriends(),
                div = $("#ui_chat .container .friend"),
                client;

        div.children().remove();

        friends.sort(function (a, b) {
            return a.pname.toLowerCase() > b.pname.toLowerCase() ? 1 : -1;
        });

        var ondiv = $("<div class='friends_online' />"),
                offdiv = $("<div class='friends_offline' />");

        for (var i = 0; i < friends.length; i++) {
            var el = $("<div id='flist_"+ friends[i].id +"' class='chat_channel entry_friend' />")
                    .append(Chat.Formatter.formatFriendClient(friends[i]));

            if (Chat.Resource.Client.STATUS_OFFLINE == friends[i].statusId)
                offdiv.append(el);
            else
                ondiv.append(el);
        }

        offdiv.toggle();
        div.append(
                $("<h2>Online</h2>").click (function () { ondiv.toggle(); }),
                ondiv,
                $("<h2>Offline</h2>").click(function () { offdiv.toggle(); }),
                offdiv
        );
    };
    EventHandler.listen("friend_added", updateFriendsList);
    EventHandler.listen("friend_removed", updateFriendsList);
    EventHandler.listen("friend_left", updateFriendsList);

    // Add tab html
    var tab = $('<div>', { class: 'friends', text: WestUi.BottomBar.links[2].title });
    $("#ui_chat > .tabs").append(tab);
    var container = $('<div>', { class: 'friend' });
    var content = $('<div>', { class: 'chat_channel', id: 'no_friends' });
    $("#ui_chat > .container .listwrap").prepend(container.append(content));

    // Add tab js
    WestUi.Chat.toggleChat = function () {
        $('#ui_chat > .tabs').toggleClass('friends');
        $('#ui_chat > .tabs > .friends').toggleClass('active');
        $('#ui_chat > .tabs > .general').toggleClass('active');
        $('#ui_chat > .container .general').toggle();
        $('#ui_chat > .container .friend').toggle();
    };
    $("#ui_chat > .tabs").click(WestUi.Chat.toggleChat);

    // Register script
    TheWestApi.register('fList', 'Friends List', '2.48', '3.00', 'Almighty Brown Tie', 'https://forum.the-west.net')
        .setGui(`<p>${meta.desc}</p><br />
        <dl>
            <dt>Version</dt> <dd>${meta.version}</dd>
            <dt>Updates</dt> <dd>${meta.updates}</dd>
            <dt>Script URL</dt> <dd>${meta.url}</dd>
        </dl>
    `);

    // Initialise
    EventHandler.listen('chat_init', () => EventHandler.signal('friend_left'));
}

